import React from 'react';

import Step0 from './step0';
import Step1 from './step1';
import Step2 from './step2';
import Step3 from './step3';
import Step4 from './step4';

const Steps = (props) => {
  return (
    <>
      <Step0 />
      <Step1 data={props.data} onChange={props.onChange}/>
      <Step2 data={props.data} onChange={props.onChange}/>
      <Step3 data={props.data} onChange={props.onChange}/>
      <Step4 data={props.data} />
    </>
  );
}

export default Steps;
